import React, { useState } from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
/* mdb-react-ui-kit */
import 'mdb-react-ui-kit/dist/css/mdb.min.css';
import "@fortawesome/fontawesome-free/css/all.min.css";
import { MDBInputGroup, MDBInput, MDBIcon, MDBBtn } from 'mdb-react-ui-kit';
import { MDBCol, MDBRow } from 'mdb-react-ui-kit';
import {
  MDBNavbar,
  MDBContainer,
  MDBNavbarNav,
  MDBNavbarItem,
  MDBNavbarLink
} from 'mdb-react-ui-kit';

function NavBar(){

  return (
    <MDBNavbar expand='lg' light bgColor='light'>
      <MDBContainer fluid>
        <MDBNavbarNav className='d-flex flex-row'>
          <MDBNavbarItem className='me-3 me-lg-0'>
            <MDBNavbarLink href='#'>
              <MDBIcon fas icon='shopping-cart' />
            </MDBNavbarLink>
          </MDBNavbarItem>
          <MDBNavbarItem className='me-3 me-lg-0'>
            <MDBNavbarLink href='#'>
              <MDBIcon fab icon='twitter' />
            </MDBNavbarLink>
          </MDBNavbarItem>
        </MDBNavbarNav>
      </MDBContainer>
    </MDBNavbar>
  );
}

function SearchBar(){

  const [showSearchAlert, setShowSearchAlert] = useState(false);
  return (
    <>
      <MDBInputGroup className = "Search-Column">
        <MDBInput label='Search' />
        <MDBBtn className = "Search-button" onClick={() => setShowSearchAlert(true)} rippleColor='dark'>
          <MDBIcon icon='search' />
        </MDBBtn>
      </MDBInputGroup>

    </>
  );
}

class Recommendation extends React.Component {
    render(){
        return(
            <div className = "Recommend">
                <h3 className = "Title"> Recommend </h3>
                <Books />
            </div>
        )
    }
}
function Books(){
  return (
    <MDBContainer>
      <MDBRow>
        <MDBCol lg='4' md='12' className='mb-4'>
          <img
            src='https://mdbootstrap.com/img/new/standard/city/041.jpg'
            className='img-fluid shadow-2-strong rounded-4'
            alt=''
          />
        </MDBCol>

        <MDBCol lg='4' md='6' className='mb-4'>
          <img
            src='https://mdbootstrap.com/img/new/standard/city/031.jpg'
            className='img-fluid shadow-2-strong rounded-4'
            alt=''
          />
        </MDBCol>

        <MDBCol lg='4' md='6' className='mb-4'>
          <img
            src='https://mdbootstrap.com/img/new/standard/city/043.jpg'
            className='img-fluid shadow-2-strong rounded-4'
            alt=''
          />
        </MDBCol>
      </MDBRow>

      <MDBRow>
        <MDBCol lg='4' md='12' className='mb-4'>
          <img
            src='https://mdbootstrap.com/img/new/standard/city/044.jpg'
            className='img-fluid shadow-2-strong rounded-4'
            alt=''
          />
        </MDBCol>

        <MDBCol lg='4' md='6' className='mb-4'>
          <img
            src='https://mdbootstrap.com/img/new/standard/city/045.jpg'
            className='img-fluid shadow-2-strong rounded-4'
            alt=''
          />
        </MDBCol>

        <MDBCol lg='4' md='6' className='mb-4'>
          <img
            src='https://mdbootstrap.com/img/new/standard/city/046.jpg'
            className='img-fluid shadow-2-strong rounded-4'
            alt=''
          />
        </MDBCol>
      </MDBRow>
    </MDBContainer>
  );
}
class FrontPage extends React.Component {
    render(){
        return(
            <div className = "FrontPage">
                <NavBar />
                <h2 className = "Title"> Search! </h2>
                <div className = "Search-Bar">
                    <SearchBar />
                </div>
                <div className = "Recommend-Block">
                    <Recommendation />
                </div>
            </div>
        )
    }
}





// ========================================

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<FrontPage />);
